import React from "react";
import { useQuery } from "react-query";
import { getAllEntries } from "../services/serverConnection";
import { DataEntry } from "../../../types";

type EntriesListProps = {}

const EntiresList: React.FC<EntriesListProps> = (props:EntriesListProps) => {
  const { entries, error, isLoading } = useQuery('items', getAllEntries);

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.toString()}</div>; 
  if (!entries) return <div>No data found</div>

  return (
    <div>
      <h1>Items</h1>
      <ul>
        {entries.map((entry: DataEntry) => (
          <li key={entry.id}>{entry.message}</li>
        ))}
      </ul>
    </div>
  );
}

export default EntiresList;
